using NUnit.Framework;
using Util;

namespace Test.Util
{
    [TestFixture]
    public class QRTest
    {
        [Test]
        public void TestUrl()
        {
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("https://google.com"));
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("http://fontys.nl"));
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("https://svendubbeld.nl"));
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("http://www.google.com"));
        }

        [Test]
        public void TestString()
        {
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("foo"));
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("FOO"));
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("bar"));
            Assert.AreEqual(
                "data:image/png;base64,",
                QR.GenerateBase64("BAR"));
        }
    }
}